import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "./Home.css"; // Update styles to reflect design
import { apiUrl } from "../axios";
import axios from "axios";

export default function Home() {
  const [doctorList, setDoctorList] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    getDoctors();
  }, []);

  const getDoctors = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`${apiUrl}/doctors`);
      if (response.status === 200) {
        setDoctorList(response.data);
      }
    } catch (error) {
      console.log(error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div id="page-top">
      <header className="masthead">
        <div className="container d-flex justify-content-between">
          {/* Left part: Logo and Pharmacy URL */}
          <div className="logo">
            <h3>Medical Store</h3>
          </div>

          {/* Right part: Sign-up, Sign-in, and Search */}
          <div className="actions d-flex align-items-center">
            {/* Update this Link to point to your login.js page */}
            <Link to="/Login">
              <button className="btn btn-outline-primary mx-2">Sign up</button>
            </Link>
            <input
              type="text"
              className="form-control mx-2"
              placeholder="Search..."
              style={{ maxWidth: "200px" }}
            />
          </div>
        </div>
      </header>

      {/* Main Section */}
      <section className="hero">
        <div className="container text-center">
          <h1>Online Medical store</h1>
          <p className="lead">Your trusted source for medications</p>
          <a href="/more" className="btn btn-link">Read More</a>
        </div>
      </section>

      {/* Discount Shelf Section */}
      <section className="shelves mt-5">
        <div className="container">
          <div className="row text-center">
            {/* Product Shelf with Discounts */}
            <div className="col-md-4">
              <div className="product">
                <h5>10% OFF</h5>
                <img src="/images/product1.jpg" alt="Product 1" className="img-fluid" />
                <p>Some Product 1</p>
              </div>
            </div>
            <div className="col-md-4">
              <div className="product">
                <h5>25% OFF</h5>
                <img src={img1}alt="Product 2" className="img-fluid" />
                <p>Some Product 2</p>
              </div>
            </div>
            <div className="col-md-4">
              <div className="product">
                <h5>15% OFF</h5>
                <img src="/images/product3.jpg" alt="Product 3" className="img-fluid" />
                <p>Some Product 3</p>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Footer Links */}
      <footer className="mt-5">
        <div className="container text-center">
          <nav>
            <Link to="/">Home</Link> | <Link to="/contact">Contact</Link> | <Link to="/about">About</Link>
          </nav>
        </div>
      </footer>
    </div>
  );
}
